import {Component, OnInit} from '@angular/core';
import {Button} from "tns-core-modules/ui/button";
import {Page} from "tns-core-modules/ui/page";
import {action} from "@nativescript/core/ui/dialogs";

const DEFAULT_BUTTON_TAB = 'btn-tab';
const ACTIVE_BUTTON_TAB = 'btn-tab btn-tab-active';

class DataItem {
	constructor(public id: number,
		public description: string) {
	}
}

@Component({
	selector: 'avaliacao-clinica',
	templateUrl: './avaliacao-clinica.component.html',
	styleUrls: ['./avaliacao-clinica.component.css'],
	moduleId: module.id,
})
export class AvaliacaoClinicaComponent implements OnInit {

	public dataList: any;
	public flightData: any;
	public tela:any;
    public typeOfService: string = 'Economy';

	public itemsList: Array<DataItem>;

	constructor(private page: Page) {
		this.itemsList = [];

		this.flightData = {
			flightDepart: {
				title: 'Chiclayo (CIX) - Lima (LIM)',
				subTitle: '10/29/18 (Depart)',
				items: [
					new DataItem(1, 'Idade'),
					new DataItem(2, 'Sol'),
					new DataItem(3, 'História de doença secundária'),
					new DataItem(4, 'fumante'),
					new DataItem(5, 'Álcool'),
				]
			}
		};

		this.dataList = this.flightData.flightDepart;
	}

	countries: { name: string, population: string, image: string }[] = [
		{ name: "Região A", population: "Lábios", image: "data:image/jpg;base64," },
		{ name: "Região B", population: "Gengiva/Mucosa", image: "data:image/jpg;base64,"},
		{ name: "Região C", population: "Mucosa/Vestítulo", image: "data:image/jpg;base64," },
		{ name: "Região D", population: "Mucosa jugal", image: "data:image/jpg;base64," },
		{ name: "Região E", population: "Palato duro", image: "data:image/jpg;base64," },
		{ name: "Região F", population: "Palato duro", image: "data:image/jpg;base64," },
		{ name: "Região G", population: "Borda lateral", image: "data:image/jpg;base64," },
		{ name: "Região H", population: "Borda lateral", image: "data:image/jpg;base64," },
		{ name: "Região I", population: "Soalho Bucal", image: "data:image/jpg;base64," },
        { name: "Região I", population: "Borda lateral", image: "data:image/jpg;base64,"},
	];

	ngOnInit() {
		this.tela = 0;
	}

    onTypeServiceTap(nome:string): void {
        let options = {
            title: "Selecione a area da lesão da "+nome,
            message: "Escolha o seu sexo",
            cancelButtonText: "Cancel",
            actions: ["Masculino", "Feminino"]
        };

        action(options).then((result) => {
            this.typeOfService = (result == 'Cancel') ? this.typeOfService : result;
        });
    }

	onSelectItem(args) {
		for (let i = 0; i < this.dataList.items.length; i++) {
			if (this.dataList.items[i].selected) {
				this.dataList.items[i].selected = false;
				break;
			}
		}
		this.dataList.items[args.index].selected = true;
	}

	onButtonTapDeparture() {
		this.dataList = this.flightData.flightDepart;

		let btnTabDeparture: Button = this.page.getViewById('btnTabDeparture');
		btnTabDeparture.className = ACTIVE_BUTTON_TAB;

		let btnTabReturn: Button = this.page.getViewById('btnTabReturn');
		btnTabReturn.className = DEFAULT_BUTTON_TAB;

		this.tela = 0;
	}

	onButtonTapReturn() {
		this.dataList = this.flightData.flightReturn;

		let btnTabReturn: Button = this.page.getViewById('btnTabReturn');
		btnTabReturn.className = ACTIVE_BUTTON_TAB;

		let btnTabDeparture: Button = this.page.getViewById('btnTabDeparture');
		btnTabDeparture.className = DEFAULT_BUTTON_TAB;

		this.tela = 1;
	}

}
